import React from 'react'
import { Button, Text, TextInput, View } from 'react-native'
import { AuthNavProps } from '../navigation/AuthParamList';
import {Inscription} from '../API/ServiceAuthentification';
export function Register({navigation}: AuthNavProps<'Register'>){
    const [TextNom, setTextNom] = React.useState('');
    const [TextPrenom, setTextPrenom] = React.useState('');
    const [TextEmail, setTextEmail] = React.useState('');
    const [TextPassword, setTextPassword] = React.useState('');
    return (
        <View>
            <TextInput
                autoCompleteType = {'name'}
                autoCorrect = {false}
                editable = {true}
                placeholder = {'Nom'}
                value = {TextNom}
                textContentType = {'name'}
                onChangeText = {text => setTextNom(text)} />
            <TextInput
                autoCompleteType = {'name'}
                autoCorrect = {false}
                editable = {true}
                placeholder = {'Prénom'}
                value = {TextPrenom}
                textContentType = {'nickname'}
                onChangeText = {text => setTextPrenom(text)} />
            <TextInput
                autoCompleteType = {'email'}
                autoCorrect = {false}
                editable = {true}
                placeholder = {'Email'}
                value = {TextEmail}
                textContentType = {'emailAddress'}
                onChangeText = {text => setTextEmail(text)} />
            <TextInput
                autoCompleteType = {'password'}
                autoCorrect = {false}
                editable = {true}
                placeholder = {'Mot de passe'}
                value = {TextPassword}
                textContentType = {'newPassword'}
                onChangeText = {text => setTextPassword(text)} />
            <Button
            title = "S'Enregistrer"
            onPress={() => {
                Inscription();
            }}></Button>
            <Button
            title = 'Annuler'
            onPress={() => {
                navigation.navigate('Login')
            }}></Button>
        </View>
    )
}
